import React, { useState, useEffect } from 'react';
import { 
  Box, 
  Typography, 
  Paper, 
  Table, 
  TableBody, 
  TableCell, 
  TableContainer, 
  TableHead, 
  TableRow,
  IconButton,
  Alert,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogContentText,
  DialogActions,
  Button,
  Card,
  CardContent
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import VisibilityIcon from '@mui/icons-material/Visibility';
import axios from 'axios';

const API_BASE_URL = 'http://localhost:8000';

const PaperManager = () => {
  const [papers, setPapers] = useState([]);
  const [error, setError] = useState('');
  const [deleteDialogOpen, setDeleteDialogOpen] = useState(false);
  const [selectedPaper, setSelectedPaper] = useState(null);
  const [viewDialogOpen, setViewDialogOpen] = useState(false);
  const [pdfContent, setPdfContent] = useState(null);

  const fetchPapers = async () => {
    try {
      const response = await axios.get(`${API_BASE_URL}/papers`);
      setPapers(response.data);
    } catch (err) {
      setError('Failed to load papers');
    }
  };

  useEffect(() => {
    fetchPapers();
  }, []);

  const handleDelete = async (paperId) => {
    try {
      await axios.delete(`${API_BASE_URL}/papers/${paperId}`);
      await fetchPapers();
      setDeleteDialogOpen(false);
      setSelectedPaper(null);
    } catch (err) {
      setError('Failed to delete paper');
    }
  };

  const openDeleteDialog = (paper) => {
    setSelectedPaper(paper);
    setDeleteDialogOpen(true);
  };

  const viewPaper = async (paper) => {
    try {
      setSelectedPaper(paper);
      const response = await axios.get(`${API_BASE_URL}/papers/${paper._id}/view`);
      setPdfContent(response.data.pdf_content);
      setViewDialogOpen(true);
    } catch (err) {
      setError('Failed to load PDF');
      console.error('Error loading PDF:', err);
    }
  };

  return (
    <Box sx={{ 
      my: 4,
      backgroundColor: '#1a1a1a',
      borderRadius: '8px',
      padding: '20px',
      color: '#fff'
    }}>
      <Typography variant="h5" gutterBottom sx={{ color: '#fff' }}>
        Manage Research Papers
      </Typography>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }}>
          {error}
        </Alert>
      )}

      <Card sx={{ 
        backgroundColor: '#2d2d2d',
        color: '#fff'
      }}>
        <CardContent>
          <TableContainer>
            <Table sx={{ 
              '& .MuiTableCell-root': { 
                color: '#fff',
                borderColor: 'rgba(255, 255, 255, 0.12)'
              }
            }}>
              <TableHead>
                <TableRow>
                  <TableCell>Title</TableCell>
                  <TableCell>Summary</TableCell>
                  <TableCell align="right">Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {papers.map((paper) => (
                  <TableRow key={paper._id} 
                    sx={{ 
                      '&:hover': { 
                        backgroundColor: 'rgba(255, 255, 255, 0.05)'
                      }
                    }}
                  >
                    <TableCell>{paper.title}</TableCell>
                    <TableCell>{paper.processed_data.summary}</TableCell>
                    <TableCell align="right">
                      <IconButton 
                        onClick={() => viewPaper(paper)}
                        sx={{ color: '#90caf9' }}
                      >
                        <VisibilityIcon />
                      </IconButton>
                      <IconButton 
                        onClick={() => openDeleteDialog(paper)}
                        color="error"
                      >
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </CardContent>
      </Card>

      <Dialog 
        open={deleteDialogOpen} 
        onClose={() => setDeleteDialogOpen(false)}
        PaperProps={{
          sx: {
            backgroundColor: '#2d2d2d',
            color: '#fff'
          }
        }}
      >
        <DialogTitle sx={{ color: '#fff' }}>Confirm Delete</DialogTitle>
        <DialogContent>
          <DialogContentText sx={{ color: 'rgba(255, 255, 255, 0.7)' }}>
            Are you sure you want to delete "{selectedPaper?.title}"?
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setDeleteDialogOpen(false)} sx={{ color: '#90caf9' }}>Cancel</Button>
          <Button 
            onClick={() => handleDelete(selectedPaper?._id)} 
            color="error"
          >
            Delete
          </Button>
        </DialogActions>
      </Dialog>

      <Dialog
        open={viewDialogOpen}
        onClose={() => {
          setViewDialogOpen(false);
          setPdfContent(null);
          setSelectedPaper(null);
        }}
        maxWidth="lg"
        fullWidth
        PaperProps={{
          sx: {
            height: '90vh',
            maxHeight: '90vh',
            backgroundColor: '#2d2d2d',
            color: '#fff'
          }
        }}
      >
        <DialogTitle sx={{ color: '#fff' }}>
          {selectedPaper?.title}
        </DialogTitle>
        <DialogContent dividers sx={{ 
          borderColor: 'rgba(255, 255, 255, 0.12)',
          '& .MuiTypography-root': { color: '#fff' }
        }}>
          {selectedPaper && (
            <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
              <Box>
                <Typography variant="h6" gutterBottom>
                  Summary
                </Typography>
                <Typography>
                  {selectedPaper.processed_data.summary}
                </Typography>
              </Box>

              <Box>
                <Typography variant="h6" gutterBottom>
                  Ideal Profile
                </Typography>
                <pre style={{ 
                  whiteSpace: 'pre-wrap',
                  fontFamily: 'inherit',
                  margin: 0,
                  color: '#fff'
                }}>
                  {JSON.stringify(selectedPaper.processed_data.ideal_profile, null, 2)}
                </pre>
              </Box>

              <Box>
                <Typography variant="h6" gutterBottom>
                  Conditions
                </Typography>
                <pre style={{ 
                  whiteSpace: 'pre-wrap',
                  fontFamily: 'inherit',
                  margin: 0,
                  color: '#fff'
                }}>
                  {JSON.stringify(selectedPaper.processed_data.conditions, null, 2)}
                </pre>
              </Box>

              {pdfContent && (
                <Box>
                  <Typography variant="h6" gutterBottom>
                    PDF Document
                  </Typography>
                  <Box sx={{ 
                    width: '100%', 
                    height: '80vh',
                    marginBottom: '20px',
                    backgroundColor: '#fff'
                  }}>
                    <iframe
                      src={`data:application/pdf;base64,${pdfContent}`}
                      width="100%"
                      height="100%"
                      title="PDF Viewer"
                      style={{ border: 'none' }}
                    />
                  </Box>
                </Box>
              )}
            </Box>
          )}
        </DialogContent>
        <DialogActions sx={{ backgroundColor: '#2d2d2d' }}>
          <Button onClick={() => {
            setViewDialogOpen(false);
            setPdfContent(null);
            setSelectedPaper(null);
          }} sx={{ color: '#90caf9' }}>
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default PaperManager;
